PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "myapp_manager" ("manager_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "phone" varchar(15) NULL, "department" varchar(100) NULL, "gender" varchar(1) NULL, "date_of_birth" date NULL, "date_joined" date NOT NULL, "salary" decimal NULL, "password" varchar(128) NULL, "face_image" varchar(100) NULL, "company_id" integer NOT NULL REFERENCES "myapp_company" ("company_id") DEFERRABLE INITIALLY DEFERRED, "shift_end" time NULL, "shift_start" time NULL, "address" text NULL);
CREATE TABLE IF NOT EXISTS "myapp_employee" ("employee_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "phone" varchar(15) NULL, "address" text NULL, "position" varchar(100) NULL, "gender" varchar(1) NULL, "date_of_birth" date NULL, "date_joined" date NOT NULL, "salary" decimal NULL, "password" varchar(128) NULL, "face_image" varchar(100) NULL, "company_id" integer NOT NULL REFERENCES "myapp_company" ("company_id") DEFERRABLE INITIALLY DEFERRED, "manager_id" integer NULL REFERENCES "myapp_manager" ("manager_id") DEFERRABLE INITIALLY DEFERRED, "shift_end" time NULL, "shift_start" time NULL);
CREATE TABLE IF NOT EXISTS "myapp_userloginhistory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_email" varchar(254) NOT NULL, "username" varchar(100) NOT NULL, "role" varchar(20) NOT NULL, "login_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "myapp_companyloginhistory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "company_name" varchar(100) NOT NULL, "username" varchar(100) NOT NULL, "email" varchar(254) NOT NULL, "login_time" datetime NOT NULL, "company_id" integer NOT NULL REFERENCES "myapp_company" ("company_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "myapp_company" ("company_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "companyName" varchar(100) NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "phone" varchar(15) NOT NULL, "city" varchar(50) NOT NULL, "password" varchar(128) NOT NULL, "num_employees" integer NOT NULL, "num_managers" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "myapp_attendance" ("attendance_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_email" varchar(254) NOT NULL, "user_name" varchar(100) NOT NULL, "user_role" varchar(20) NOT NULL, "date" date NOT NULL, "expected_entry_time" time NULL, "expected_exit_time" time NULL, "real_entry_time" time NULL, "real_exit_time" time NULL, "company_id" integer NOT NULL REFERENCES "myapp_company" ("company_id") DEFERRABLE INITIALLY DEFERRED, "employee_id" integer NULL REFERENCES "myapp_employee" ("employee_id") DEFERRABLE INITIALLY DEFERRED, "manager_id" integer NULL REFERENCES "myapp_manager" ("manager_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "myapp_taskassignment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "is_completed_by_user" bool NOT NULL, "completion_notes" text NULL, "employee_id" integer NULL REFERENCES "myapp_employee" ("employee_id") DEFERRABLE INITIALLY DEFERRED, "manager_id" integer NULL REFERENCES "myapp_manager" ("manager_id") DEFERRABLE INITIALLY DEFERRED, "task_id" bigint NOT NULL REFERENCES "myapp_task" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "myapp_task" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(200) NOT NULL, "description" text NOT NULL, "start_date" date NOT NULL, "end_date" date NOT NULL, "created_at" datetime NOT NULL, "is_completed" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
